let successmusic='data:audio/wav;base64,';

import Component from '@ember/component';

export default Component.extend({
    didRender(){
        let svg=d3.select('body').select('svg');
        let size=100;
        let columns=15;
        let rows=4;
        let model=this.get('model');
        let stonesize=5;

        // The underlying grid.
        svg.append('g').
            selectAll('rect').
            // There is a parking column below.
            data(Array.from({length:(rows+1)*columns},(v,k)=>k)).
            enter().
            append('rect').
            attr('x', function(d){return (d%columns)*size;}).
            attr('y', function(d){return Math.floor(d/columns)*size;}).
            attr('fill', function(d){
                if(Math.floor(d/columns)==rows-1){
                    return 'lightgrey';
                }
                return 'white';
            }).
            attr('stroke', 'black').
            attr('width', function(d){return size;}).
            attr('height', function(d){return size;});

        function createBorderedstone(group, x, y, style){
            group.
                append('rect').
                attr('class', 'borderstone').
                attr('x', x).
                attr('y', y).
                attr('rx', 5).
                attr('ry', 5).
                attr('width', size).
                attr('height', size);
            group.
                append('rect').
                attr('class', style).
                attr('x', x+1).
                attr('y', y+1).
                attr('rx', 5).
                attr('ry', 5).
                attr('width', size-2).
                attr('height', size-2);
        }

        function createBasestone(group){
            for(let i of Array.from({length:5}, (p, c)=>c)){
                createBorderedstone(group, i*size, 0, 'basestone')
            }
        }

        // Taken from: https://bost.ocks.org/mike/shuffle/
        function shuffle(array) {
            var m = array.length, t, i;
            while (m) {
                i = Math.floor(Math.random() * m--);
                t = array[m];
                array[m] = array[i];
                array[i] = t;
            }
            return array;
        }
        let shuffledRows=shuffle(Array.from({length: rows-1}, (v, k)=>k))
        let shuffledCols=shuffle(Array.from({length: columns-6}, (v, k)=>k))

        //Called when drag event starts. It stop the propagation of the click event
        function dragstarted(d){
            d3.event.sourceEvent.stopPropagation();
        }

        function createDrag(stonegroup){
            //Create the drag and drop behavior to set for the objects crated
            let drag=createDragfunction(stonegroup);
            return d3.drag()
                .on("start", dragstarted)
                .on("drag", drag)
                .on('end', dragended);
        }

        function createDragfunction(stone){
            //Called when the drag event occurs (object should be moved)
            return function(){
                let x=d3.event.x;
                let y=d3.event.y;
                let draggedx=Math.max(0, Math.min(columns-stonesize, Math.round(x/size))*size);
                stone.data()[0]['x']=draggedx;
                let draggedy=Math.max(0, Math.min(rows-1, Math.round(y/size))*size);
                stone.data()[0]['y']=draggedy;
                stone.attr('transform', 'translate('+stone.data()[0]['x']+', '+stone.data()[0]['y']+')');
            }
        }

        function dragended(d){
            let matrix=Array.from({length: rows}, (v, k)=>{return Array.from({length: columns}, (v, k)=>0)});
            d3.selectAll('.activestone').each(function(){
                let svgrect=d3.select('svg').node().getBoundingClientRect();
                let origin=[svgrect.x, svgrect.y];
                let activeRect=this.getBoundingClientRect();
                let isparking=Math.round((activeRect.y-origin[1])/size)==rows-1;
                if(!isparking){
                    matrix[Math.round((activeRect.y-origin[1])/size)][Math.round((activeRect.x-origin[0])/size)]=1;
                }
            });

            for(let pattern of model.patterns){
                if(!pattern.solved){
                    let success=pattern.succes(matrix);
                    pattern.set('solved', success);

                    if(success){
                        var audio = new Audio(successmusic);
                        audio.play();
                    }

                    break;
                }
            }
        }

        for(let stoneindex=0; stoneindex<model.stones.length; stoneindex++){
            let stone=model.stones[stoneindex];
            let stonegroup=svg.append('g');
            createBasestone(stonegroup);
            stonegroup.call(createDrag(stonegroup));
            for(let activeindex=0;activeindex<stone.length;activeindex++){
                if(stone[activeindex]){
                    createBorderedstone(stonegroup, activeindex*size, 0, 'activestone');
                }
            }
            stonegroup.data([{'x': shuffledCols[stoneindex]*size, 'y': shuffledRows[stoneindex]*size}]);
            stonegroup.attr('transform', 'translate('+stonegroup.data()[0]['x']+', '+stonegroup.data()[0]['y']+')');
        }
    }
});

